import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';
import logo from './entur_logo.jpg';
import Background from './background.jpg';

class NavBar extends React.Component {

    render() {
        return (
            <div className="navBar">
                <div className="logo">
                    <img src={logo} width={180} height={80} />
                </div>
            </div>
        )
    }
}

class Register_box extends React.Component {

    handleClick = (props) => {
        window.alert(props)
        localStorage.setItem('myData', props);
    };

    render() {
        return (
            <form>
                <h3 className="text-center text-white">Registrer ny melding</h3>
                <br></br>
                <div className="form-row d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="fromDate p-2 flex-grow-1">
                        <p className="text-center text-white">Fra</p>
                        <input type="datetime-local" className="form-control" placeholder="Fra dato"/>
                    </div>
                    <div className="toDate p-2 flex-grow-1">
                        <p className="text-center text-white">Til</p>
                        <input type="datetime-local" className="form-control" placeholder="Til dato"/>
                    </div>
                </div>
                <div className="message">
                    <p className="text-center text-white">Melding</p>
                    <input type="String" className="form-control" placeholder="Melding"/>
                </div>
                <br></br>
                <br></br>
                <Dropdown>
                    <Dropdown.Toggle variant="success" id="dropdown-basic">
                        Dropdown Button
                    </Dropdown.Toggle>

                    <Dropdown.Menu>
                        <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                        <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
                        <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
                    </Dropdown.Menu>
                </Dropdown>
                <div className="search">
                    <input type="String" className="form-control" placeholder="Søk"/>
                </div>
                <br></br>
                <br></br>
                <div className="sumbit">
                    <button type="submit" className="btn btn-primary btn-lg btn-block">Submit</button>
                </div>
            </form>



        );
    }
}

class New_SX extends React.Component {
    render() {
        return (
            <div className="new_sx">
                <img id="background" src={ Background } />
                <div className="navBar">
                    <NavBar />
                </div>
                <div className="register_box" >
                    <Register_box />
                </div>
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <New_SX />,
    document.getElementById('root')
);
